import React from 'react';
import styled from 'styled-components';

const MainPage = () => {
  return (

    <MainWrapper>
      <SectionTitle>인기 프로젝트</SectionTitle>
      <ProjectList>
        {Array(3).fill().map((_, index) => (
          <ProjectCard key={index}>
            <ProjectOwner>Brynn Park</ProjectOwner>
            <ProjectTitle>블록체인 DApp 프로젝트</ProjectTitle>
            <ProjectInfo>
              <Tags>AWS, Blockchain, React</Tags>
              <Details>모집인원: 3/4명 | 마감일: 2024.07.29</Details>
            </ProjectInfo>
          </ProjectCard>
        ))}
      </ProjectList>

      <SectionTitle>프로젝트 목록</SectionTitle>
      <ProjectList>
        {Array(3).fill().map((_, index) => (
          <ProjectCard key={index}>
            <ProjectOwner>차운우</ProjectOwner>
            <ProjectTitle>재난 대응 어플리케이션 백엔드 구해요!</ProjectTitle>
            <ProjectInfo>
              <Tags>AWS, Blockchain, Python</Tags>
              <Details>모집인원: 3/4명 | 마감일: 2024.08.08</Details>
            </ProjectInfo>
            <ApplyButton>신청하기</ApplyButton>
          </ProjectCard>
        ))}
      </ProjectList>
    </MainWrapper>
  );
}

export default MainPage;

const MainWrapper = styled.div`

  padding: 20px;
  min-height: calc(100vh - 40%);

`;

const SectionTitle = styled.h2`
  font-size: 24px;
  margin-bottom: 20px;
`;

const ProjectList = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 20px;
`;

const ProjectCard = styled.div`
  border: 1px solid #ddd;
  border-radius: 10px;
  padding: 15px;
  width: calc(33% - 20px);
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
`;

const ProjectOwner = styled.div`
  font-weight: bold;
`;

const ProjectTitle = styled.div`
  font-size: 18px;
  margin: 10px 0;
`;

const ProjectInfo = styled.div`
  font-size: 14px;
  color: #777;
`;

const Tags = styled.div`
  margin-bottom: 5px;
`;

const Details = styled.div``;

const ApplyButton = styled.button`
  margin-top: 10px;
  padding: 10px;
  color: white;
  background-color: #0080ff;
  border: none;
  border-radius: 5px;
  cursor: pointer;

  &:hover {
    background-color: #005bb5;
  }
`;
